import styled from "styled-components"

export const Container = styled.div`
  padding-top: 150px;
  box-sizing: border-box;
  background-color: #f6f6f6;
  width: 100%;
  height: 100%;
  min-width: 850px;
  min-height: 930px;
  position: absolute;
  z-index: 1;
  overflow: hidden;
`
